ilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Flogseq____&quot;,960,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Xlogseq____&quot;,276,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Vlogseq____&quot;,276,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Ulogseq____&quot;,276,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Ulogseq____&quot;,277,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Ulogseq____&quot;,418,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Jlogseq____&quot;,[],536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Hlogseq____&quot;,277,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^Hlogseq____&quot;,418,536870970]],[logseq____&quot;^15logseq____&quot;,[962,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66464c58-4a9b-4a3e-9409-b464c106584alogseq____&quot;,536870970]],[logseq____&quot;^15logseq____&quot;,[963,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;?logseq____&quot;,536870970]],[logseq____&quot;^15logseq____&quot;,[963,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870970]],[logseq____&quot;^15logseq____&quot;,[963,logseq____&quot;^Flogseq____&quot;,968,536870970]],[logseq____&quot;^15logseq____&quot;,[963,logseq____&quot;^Xlogseq____&quot;,276,536870970]],[logseq  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // ----------------------------------------------------------------------
      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
